    open fun shuffle(arr: UTSArray<Any>): UTSArray<Any> {
        var i = arr.length;
        while(i != 0){
            var j = Math.floor(Math.random() * i--);
            var t_j = arr[j];
            var t_i = arr[i];
            arr[j] = t_i;
            arr[i] = t_j;
        }
        return arr;
    }
    private var timer: Number = 0;
    private var flag = false;
    open fun throttle(kFun: () -> Unit, wait: Number): Unit {
        if (wait <= 0) {
            if (!this.flag) {
                this.flag = true;
                kFun();
                this.timer = setTimeout(fun(){
                    this.flag = false;
                }
                , wait);
            }
        } else if (!this.flag) {
            this.flag = true;
            this.timer = setTimeout(fun(){
                this.flag = false;
                kFun();
            }
            , wait);
        }
    }
    open fun debounce(kFun: () -> Unit, wait: Number): Unit {
        clearTimeout(this.timer);
        if (wait <= 0) {
            kFun();
        } else {
            this.timer = setTimeout(fun(){
                kFun();
            }
            , wait);
        }
    }
