        val max = Math.pow(10, digit);
        return Math.floor(Math.random() * (max - min + 1)) + min;
    }
    open fun uuid(): String {
        val chars = "0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz".split("");
        var uuid: UTSArray<String> = utsArrayOf();
        run {
            var i: Number = 0;
            while(i < 36){
                var r = 0 or Math.random() * 16;
                var c = chars[if ((i == 19)) {
                    (r and 0x3) or 0x8;
                } else {
                    r;
                }
                ];
                uuid.push(c);
                i++;
            }
        }
        uuid[8] = "-";
        uuid[13] = "-";
        uuid[18] = "-";
        uuid[23] = "-";
        uuid[14] = "4";
        return uuid.join("");
    }
}
