fun useDrawLoading(ctx: DrawableContext, width: Number, iconColor: ComputedRefImpl<String>, timer: Ref<Number>) {
    var startAngle: Number = 0;
    var endAngle: Number = 0;
    var startSpeed: Number = 0;
    var endSpeed: Number = 0;
    var rotate: Number = 0;
    val ARC_LENGTH: Number = 359.99;
    val PI = Math.PI / 180;
    val SPEED: Number = 0.02;
    val ROTATE_INTERVAL: Number = 0.09;
    val center = width / 2;
    val lineWidth = width / 10;
    fun easeInOutCubic(t: Number): Number {
        return if (t < 0.5) {
            4 * t * t * t;
        } else {
            (t - 1) * (2 * t - 2) * (2 * t - 2) + 1;
        }
        ;
    }
    fun draw() {
        ctx.reset();
        ctx.lineCap = "round";
        ctx.beginPath();
        ctx.arc(center, center, center - lineWidth, startAngle * PI + rotate, endAngle * PI + rotate);
        ctx.lineWidth = lineWidth;
        ctx.strokeStyle = iconColor.value;
        ctx.stroke();
        if (endAngle < ARC_LENGTH && startAngle == 0) {
            endSpeed += SPEED;
            endAngle = Math.min(ARC_LENGTH, easeInOutCubic(endSpeed) * ARC_LENGTH);
        } else if (endAngle == ARC_LENGTH && startAngle < ARC_LENGTH) {
            startSpeed += SPEED;
            startAngle = Math.min(ARC_LENGTH, easeInOutCubic(startSpeed) * ARC_LENGTH);
        } else if (endAngle >= ARC_LENGTH && startAngle >= ARC_LENGTH) {
            endSpeed = 0;
            startSpeed = 0;
            startAngle = 0;
            endAngle = 0;
        }
        rotate += ROTATE_INTERVAL;
        ctx.update();
    }
    timer.value = setInterval(fun(){
        return draw();
    }
    , 24);
}
