val longText1 = "先帝创业未半而中道崩殂，今天下三分，益州疲弊，此诚危急存亡之秋也。然侍卫之臣不懈于内，忠志之士忘身于外者，盖追先帝之殊 遇，欲报之于陛下也。诚宜开张圣听，以光先帝遗德，恢弘志士之气，不宜妄自菲薄，引喻失义，以塞忠谏之路也。宫中府中，俱为一体，陟罚臧否，不宜异同。若有作奸犯科及为忠善者，宜付有司论其刑赏，以昭陛下平明之理，不宜偏私，使内外异法也。侍中、侍郎郭攸之、费祎、董允等，此皆良实，志虑忠纯，是以先帝简拔以遗陛下。愚以为宫中之事，事无大小，悉以咨之，然后施行，必能裨补阙漏，有所广益。将军向宠，性行淑均，晓畅军事，试用于昔日，先帝称之曰能，是以众议举宠为督。愚以为营中之事，悉以咨之，必能使行阵和睦，优劣得所。亲贤臣，远小人，此先汉所以兴隆也；亲小人，远贤臣，此后汉所以倾颓也。先帝在时，每与臣论此事，未尝不叹息痛恨于桓、灵也。侍中、尚书、长史、参军，此悉贞良死节之臣，愿陛下亲之信之，则汉室之隆，可计日而待也。臣本布衣，躬耕于南阳，苟全性命于乱世，不求闻达于诸侯。先帝不以臣卑鄙，猥自枉屈，三顾臣于草庐之中，咨臣以当世之事，由是感激，遂许先帝以驱驰。后值倾覆，受任于败军之际，奉命于危难之间，尔来二十有一年矣。先帝知臣谨慎，故临崩寄臣以大事也。受命以来，夙夜忧叹，恐托付不效，以伤先帝之明，故五月渡泸，深入不毛。今南方已定，兵甲已足，当奖率三军，北定中原，庶竭驽钝，攘除奸凶，兴复汉室，还于旧都。此臣所以报先帝而忠陛下之职分也。至于斟酌损益，进尽忠言，则攸之、祎、允之任也。愿陛下托臣以讨贼兴复之效，不效，则治臣之罪，以告先帝之灵。若无兴德之言，则责攸之、祎、允等之慢，以彰其咎；陛下亦宜自谋，以咨诹善道，察纳雅言，深追先帝遗诏，臣不胜受恩感激。今当远离，临表涕零，不知所言。";
val longText2 = "庆历四年春，滕子京谪守巴陵郡。越明年，政通人和，百废具兴，乃重修岳阳楼，增其旧制，刻唐贤今人诗赋于其上，属予作文以记之 。予观夫巴陵胜状，在洞庭一湖。衔远山，吞长江，浩浩汤汤，横无际涯，朝晖夕阴，气象万千，此则岳阳楼之大观也，前人之述备矣。然则北通巫峡，南极潇湘，迁客骚人，多会于此，览物之情，得无异乎？若夫淫雨霏霏，连月不开，阴风怒号，浊浪排空，日星隐曜，山岳潜形，商旅不行，樯倾楫摧，薄暮冥冥，虎啸猿啼。登斯楼也，则有去国怀乡，忧谗畏讥，满目萧然，感极而悲者矣。至若春和景明，波澜不惊，上下天光，一碧万顷，沙鸥翔集，锦鳞游泳，岸芷汀兰，郁郁青青。而或长烟一空，皓月千里，浮光跃金，静影沉璧，渔歌互答，此乐何极！登斯楼也，则有心旷神怡，宠辱偕忘，把酒临风，其喜洋洋者矣。嗟夫！予尝求古仁人之心，或异二者之为，何哉？不以物喜，不以己悲，居庙堂之高则忧其民，处江湖之远则忧其君。是进亦忧，退亦忧。然则何时而乐耶？其必曰“先天下之忧而忧，后天下 之乐而乐”乎！噫！微斯人，吾谁与归？时六年九月十五日。";
val longText3 = "晋太元中，武陵人捕鱼为业。缘溪行，忘路之远近。忽逢桃花林，夹岸数百步，中无杂树，芳草鲜美，落英缤纷。渔人甚异之，复前行 ，欲穷其林。林尽水源，便得一山，山有小口，仿佛若有光。便舍船，从口入。初极狭，才通人。复行数十步，豁然开朗。土地平旷，屋舍俨然，有良田、美池、桑竹之属。阡陌交通，鸡犬相闻。其中往来种作，男女衣着，悉如外人。黄发垂髫，并怡然自乐。见渔人，乃大惊，问所从来。具答之。便要还家，设酒杀鸡作食。村中闻有此人，咸来问讯。自云先世避秦时乱，率妻子邑人来此绝境，不复出焉，遂与外人间隔。问今是何世，乃不知有汉，无论魏晋。此人一一为具言所闻，皆叹惋。余人各复延至其家，皆出酒食。停数日，辞去。此中人语云：“不足为外人道也。”既出，得其船，便扶向路，处处志之。及郡下，诣太守，说如此。太守即遣人随其往，寻向所志，遂迷，不复得路。南阳刘子骥，高尚士也，闻之，欣然规往。未果，寻病终，后遂无问津者。";
val article1 = "\u6D54\u9633\u6C5F\u5934\u591C\u9001\u5BA2\uFF0C\u67AB\u53F6\u837B\u82B1\u79CB\u745F\u745F\u3002\n\u4E3B\u4EBA\u4E0B\u9A6C\u5BA2\u5728\u8239\uFF0C\u4E3E\u9152\u6B32\u996E\u65E0\u7BA1\u5F26\u3002\n\u9189\u4E0D\u6210\u6B22\u60E8\u5C06\u522B\uFF0C\u522B\u65F6\u832B\u832B\u6C5F\u6D78\u6708\u3002\n\u5FFD\u95FB\u6C34\u4E0A\u7435\u7436\u58F0 \uFF0C\u4E3B\u4EBA\u5FD8\u5F52\u5BA2\u4E0D\u53D1\u3002\n\u5BFB\u58F0\u6697\u95EE\u5F39\u8005\u8C01\uFF0C\u7435\u7436\u58F0\u505C\u6B32\u8BED\u8FDF\u3002\n\u79FB\u8239\u76F8\u8FD1\u9080\u76F8\u89C1\uFF0C\u6DFB\u9152\u56DE\u706F\u91CD\u5F00\u5BB4\u3002\n\u5343\u547C\u4E07\u5524\u59CB\u51FA\u6765\uFF0C\u72B9\u62B1\u7435\u7436\u534A\u906E\u9762\u3002\n\u8F6C\u8F74\u62E8\u5F26\u4E09\u4E24\u58F0\uFF0C\u672A\u6210\u66F2\u8C03\u5148\u6709\u60C5\u3002\n\u5F26\u5F26\u63A9\u6291\u58F0\u58F0\u601D\uFF0C\u4F3C\u8BC9\u5E73\u751F\u4E0D\u5F97\u5FD7\u3002\n\u4F4E\u7709\u4FE1\u624B\u7EED\u7EED\u5F39\uFF0C\u8BF4\u5C3D\u5FC3\u4E2D\u65E0\u9650\u4E8B\u3002\n\u8F7B\u62E2\u6162\u637B\u62B9\u590D\u6311\uFF0C\u521D\u4E3A\u300A\u9713\u88F3\u300B\u540E\u300A\u516D\u5E7A\u300B\u3002\n\u5927\u5F26\u5608\u5608\u5982\u6025\u96E8\uFF0C\u5C0F\u5F26\u5207\u5207\u5982\u79C1\u8BED\u3002\n\u5608\u5608\u5207\u5207\u9519\u6742\u5F39\uFF0C\u5927\u73E0\u5C0F\u73E0\u843D\u7389\u76D8\u3002\n\u95F4\u5173\u83BA\u8BED\u82B1\u5E95\u6ED1\uFF0C\u5E7D\u54BD\u6CC9\u6D41\u51B0\u4E0B\u96BE\u3002\n\u51B0\u6CC9\u51B7\u6DA9\u5F26\u51DD\u7EDD\uFF0C\u51DD\u7EDD\u4E0D\u901A\u58F0\u6682\u6B47\u3002\n\u522B\u6709\u5E7D\u6101\u6697\u6068\u751F\uFF0C\u6B64\u65F6\u65E0\u58F0\u80DC\u6709\u58F0\u3002\n\u94F6\u74F6\u4E4D\u7834\u6C34\u6D46\u8FF8\uFF0C\u94C1\u9A91\u7A81\u51FA\u5200\u67AA\u9E23\u3002\n\u66F2\u7EC8\u6536\u62E8\u5F53\u5FC3\u753B\uFF0C\u56DB\u5F26\u4E00\u58F0\u5982\u88C2\u5E1B\u3002\n\u4E1C\u8239\u897F\u822B\u6084\u65E0\u8A00\uFF0C\u552F\u89C1\u6C5F\u5FC3\u79CB\u6708\u767D\u3002\n\u6C89\u541F\u653E\u62E8\u63D2\u5F26\u4E2D\uFF0C\u6574\u987F\u8863\u88F3\u8D77\u655B\u5BB9\u3002\